import React, { useCallback, useEffect } from 'react'

export default function FetchApi() {
    useEffect(()=>{
        fetch("https://dummyjson.com/quotes")
        .then(response=>response.json())
        
    })
  return (
    <div>FetchApi</div>
  )
}
